// HomePage.js
import React from "react";
import Header from "../../components/ui/header/header";
import Footer from "../../components/ui/footer/footer";
import ReportButton from "./table/button/buttonReport";
import FilterDashboard from "../ReportPage/table/button/FilterDashboard/filterDashboard";

function ReportPage() {
  return (
    <div>
      <Header />
      <FilterDashboard />
      <ReportButton />

      <Footer />
    </div>
  );
}

export default ReportPage;
